import { Navbar } from 'react-bootstrap';

export const Iconos = (icon, title) => {
    return(
        <Navbar className="navbar">
            <a href='/'>
                <span>{icon}</span>
                <p>{title}</p>
            </a>
        </Navbar>
    )
}
